import React from 'react';
import { Button as MuiButton } from '@mui/material';

const SimpleButton = ({ title, onClick, color='primary' }) => {
  return (
    <MuiButton variant="contained" color={color} onClick={onClick}>
      {title}
    </MuiButton>
  );
};

export default SimpleButton;
